INSERT INTO `books` (`BookID`, `AuthorID`, `Price`, `Title`, `Publisher`, `PublicationDate`, `Description`, `Genre`, `Language`, `quantity`, `Image`) VALUES
(1, 1, 5.00, 'Konrad Wallenrod', 'Wydawnictwo SBM', '2021-08-16', 'Klasyka literatury polskiej i światowej w starannym wydaniu z przypisami – to książka, którą warto mieć w swojej domowej biblioteczce i do której warto wracać. Tekst opatrzono wskazówkami interpretacyjnymi i hasłami ułatwiającymi nawigację po książce – dzięki nim łatwo znaleźć potrzebny w trakcie omawiania lektury fragment, zgromadzić materiały do wypracowań i ustnych wypowiedzi, zapamiętać najważniejsze informacje i utrwalić znajomość lektury.', 'Literatura Piękna', 'polski', 10, );
INSERT INTO `books` (`BookID`, `AuthorID`, `Price`, `Title`, `Publisher`, `PublicationDate`, `Description`, `Genre`, `Language`, `quantity`, `Image`) VALUES
(2, 1, 3.80, 'Dziady cz. IV', 'piszmy po książkach', '2019-01-01', 'Czwarta część Dziadów rozgrywa się w noc tytułowego święta w chacie ruskiego księdza. Kapłan potępia zabobony i zakazuje mieszkańcom odprawiania obrzędu. W środku nocy pod domem pojawia się zbłąkany wędrowiec, który wstępuje na odpoczynek i poczęstunek. Jego wygląd oraz to co mówi, przejmuje strachem początkowo tylko dzieci, jednak niedługo później coraz większy niepokój zaczyna ogarniać także samego gospodarza.', 'Dramat', 'polski', 0, );
INSERT INTO `books` (`BookID`, `AuthorID`, `Price`, `Title`, `Publisher`, `PublicationDate`, `Description`, `Genre`, `Language`, `quantity`, `Image`) VALUES
(3, 3, 4.00, 'Balladyna', 'Wilga', '2021-07-28', 'Balladyna to dramat w pięciu aktach, napisany przez Juliusza Słowackiego w epoce romantyzmu. To opowieść o żądzy władzy i rywalizacji. Imię głównej bohaterki – Balladyna – nawiązuje do gatunku literackiego, jakim jest ballada, w której pojawiają się motywy fantastyczne i elementy wierzeń ludowych.\nBalladyna od lat znajduje się w kanonie lektur szkolnych omawianych na lekcjach języka polskiego.\nNowoczesny projekt książki przyciągnie uwagę młodszych czytelników.', 'Dramat', 'polski', 6, );
INSERT INTO `books` (`BookID`, `AuthorID`, `Price`, `Title`, `Publisher`, `PublicationDate`, `Description`, `Genre`, `Language`, `quantity`, `Image`) VALUES
(4, 3, 2.00, 'Beniowski', 'Greg', '2012-01-15', 'Poemat dygresyjny opowiadający o losach młodego podolskiego szlachcica Maurycego Beniowskiego, który po tym, jak przehulał dziedziczny majątek, wyruszył w świat. Słowacki opisuje jego liczne przygody, m.in. obronę Baru, pojedynek z Sawą i wyprawę na Krym. Jest to jednak jedynie pretekst do dygresji, które zajmują w utworze nie mniej miejsca, co fabuła, a które służą autorowi jako polemika z powszechnym rozumieniem romantyzmu.', 'Klasyka', 'polski', 3, );
INSERT INTO `books` (`BookID`, `AuthorID`, `Price`, `Title`, `Publisher`, `PublicationDate`, `Description`, `Genre`, `Language`, `quantity`, `Image`) VALUES
(5, 3, 2.50, 'Fantazy', 'Greg', '2012-01-01', '\"Fantazy czyli Nowa Dejanira\", zwany też \"Niepoprawni\" (powst. 1841-1846, wyd. 1866) to dramat złożony, łączący elementy tragiczne i komediowe, ironiczna prezentacja romantycznej mody i stylu bycia, która powoli przeistacza się w dramat metafizyczny. Akcja utworu koncentruje się wokół miłości Dianny, córki zubożałego hrabiego Respekta, i zesłańca sybirskiego, Jana. Wątek ten staje się okazją do ukazania życia upadającej arystokracji oraz podjęcia tematu romantycznej miłości, która w przypadku przesadnie uczuciowego i patetycznego związku hrabiego Fantazego i hrabiny Idalii zostaje sparodiowana. Fantazy\" nakreślił poeta obraz moralnego rozłamu społeczeństwa polskiego. U jego źródeł tkwiła niszcząca siła pieniądza, zmuszająca jednych do bezwzględnej walki o byt, umożliwiająca innym egoistyczne, wrogie, bo krzywdzące bliźnich działania - a z drugiej strony prowokująca do otwartego buntu przeciwko złowrogiej mocy \"wojsk dukatowych\".', 'Dramat', 'polski', 7, );
INSERT INTO `books` (`BookID`, `AuthorID`, `Price`, `Title`, `Publisher`, `PublicationDate`, `Description`, `Genre`, `Language`, `quantity`, `Image`) VALUES
(6, 4, 1.50, 'Kamienie na szaniec', 'Nasza Księgarnia', '2014-02-26', 'Opowieść o Bohaterach Szarych Szeregów – Rudym, Alku, Zośce, zilustrowana ponad osiemdziesięcioma zdjęciami ze wszystkich epok Ich życia – od gniazda rodzinnego, poprzez czas harcerstwa, miłości, walki, po dni ostatnie! Po raz pierwszy pełny tekst, bez skreśleń cenzury PRL. Wydanie wzbogacone zdjęciami młodzieży z drużyn i szkół noszących imiona Janka Bytnara – Rudego, Alka Dawidowskiego, Tadeusza Zawadzkiego – Zośki, Aleksandra Kamińskiego – Kamyka. Ta niezwykła edycja poprzedzona jest wstępem Barbary Wachowicz, autorki sławnej wystawy \"Kamyk na szańcu\" i cyklu Wierna rzeka harcerstwa. We wstępie po raz pierwszy znalazły się fragmenty nieznanego pamiętnika Druha Aleksandra Kamińskiego i jego list, jedyny, w którym mówi, jak stworzył Kamienie na szaniec, a także niezwykła korespondencja Basi i Alka, wspomnienia Matki i Siostry Rudego, pasjonujące relacje przyjaciół i towarzyszy broni.', 'Historyczne', 'polski', 11, );
INSERT INTO `books` (`BookID`, `AuthorID`, `Price`, `Title`, `Publisher`, `PublicationDate`, `Description`, `Genre`, `Language`, `quantity`, `Image`) VALUES
(7, 2, 2.50, 'Krzyżacy', 'Bellona', '2017-01-01', 'ZBYSZKO I MAĆKO Z BOGDAŃCA PRZECIWKO ZŁYM I PODSTĘPNYM KRZYŻAKOM. W TLE NIESZCZĘŚLIWA MIŁOŚĆ. A TAKŻE WIELKA HISTORIA, KTÓRA PROWADZI BOHATERÓW NA POLE KRWAWEJ BITWY POD GRUNWALDEM, GDZIE POD MIECZAMI POLAKÓW I LITWINÓW UPADNIE POTĘGA I PYCHA ZAKONU. Jedna z najsłynniejszych powieści historycznych Henryka Sienkiewicza. Akcja utworu toczy się od roku 1399 (rok śmierci królowej Jadwigi) do roku 1410 (bitwa pod Grunwaldem). Gdy ją opublikowano, powieść była protestem przeciwko germanizacji prowadzonej przez władze zaboru pruskiego. Sienkiewicz chciał, aby jego książka ukazywała Polskę w okresie świetności jej oręża. Tłem historycznym Krzyżaków jest konflikt jagiellońskiej Polski z zakonem krzyżackim. W 1960 roku, w 550. rocznicę bitwy pod Grunwaldem, powstał film w reżyserii Aleksandra Forda. Książka została przetłumaczona na 25 języków', 'Klasyka', 'polski', 21, );
INSERT INTO `books` (`BookID`, `AuthorID`, `Price`, `Title`, `Publisher`, `PublicationDate`, `Description`, `Genre`, `Language`, `quantity`, `Image`) VALUES
(8, 2, 1.90, 'Potop', 'Wydawnictwo SBM', '2020-02-20', 'Lektura wraz opracowaniem to znakomita pomoc i inspiracja dla uczniów oraz nauczycieli. Tekst opatrzono wskazówkami interpretacyjnymi i hasłami ułatwiającymi nawigację po książce – dzięki nim łatwo znaleźć potrzebny w trakcie omawiania lektury fragment, zgromadzić materiały do wypracowań i ustnych wypowiedzi, zapamiętać najważniejsze informacje i utrwalić znajomość lektury. Zamieszczone na końcu książki opracowanie podporządkowano podstawie programowej. Zawiera ono ciekawy biogram autora, streszczenie, mapę mentalną, najważniejsze zagadnienia omawiane na lekcjach, a także wiele inspirujących informacji, podpowiedzi i zadań, dzięki którym czytanie lektury staje się twórczą przygodą. Opracowanie powstało pod kierunkiem Katarzyny Zioły-Zemczak, nauczycielki języka polskiego z bogatym doświadczeniem w pracy z dziećmi i młodzieżą, wieloletniej doradczyni metodycznej, a obecnie konsultantki ds. języka polskiego pracującej na co dzień z nauczycielami.', 'Historyczne', 'polski', 38, );

